import{_ as e,a,b as r,c as t,d as i}from"./chunks/rtk_fem_fb_2.j1iLjbtY.js";import{_ as o,c as n,o as s,ab as l}from"./chunks/framework.CUflZczI.js";const k=JSON.parse('{"title":"Femtones MINI2 수신기","description":"","frontmatter":{},"headers":[],"relativePath":"ko/gps_compass/rtk_gps_fem_mini2.md","filePath":"ko/gps_compass/rtk_gps_fem_mini2.md"}'),p={name:"ko/gps_compass/rtk_gps_fem_mini2.md"},m=l('<h1 id="femtones-mini2-수신기" tabindex="-1">Femtones MINI2 수신기 <a class="header-anchor" href="#femtones-mini2-수신기" aria-label="Permalink to &quot;Femtones MINI2 수신기&quot;">​</a></h1><p><a href="http://www.femtomes.com/#/MiniII?type=0" target="_blank" rel="noreferrer">MINI2 Receiver</a> is an RTK GPS receiver that delivers high-rate and reliable RTK initialization for centimeter level positioning. It is intended for applications that require high-precision positioning (e.g. navigation and mapping, etc.).</p><p>수신기는 직렬 포트 (UART)를 통하여 PX4에 연결되며, 표준 웹 브라우저를 사용하여 설정할 수 있습니다.</p><p><img src="'+e+'" alt="MINI II 수신기"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>PX4 drivers for Ethernet, CAN and USB are under development.</p></div><h2 id="필수-펌웨어-옵션" tabindex="-1">필수 펌웨어 옵션 <a class="header-anchor" href="#필수-펌웨어-옵션" aria-label="Permalink to &quot;필수 펌웨어 옵션&quot;">​</a></h2><p>장치 구매시 다음 펌웨어 옵션을 선택하여야 합니다.</p><ul><li>5Hz, 10Hz, 20Hz</li><li>INS</li><li>HEADING</li><li>OBS</li><li>RTK</li><li>BASE</li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p>Contact <a href="http://www.femtomes.com/" target="_blank" rel="noreferrer">Femtones</a> directly for sales quote:</p><ul><li><strong>전자메일:</strong> <a href="mailto:sales@femtomes.com" target="_blank" rel="noreferrer">sales@femtomes.com</a></li><li><strong>전화:</strong> +86-10-53779838</li></ul><h2 id="기능성-포트" tabindex="-1">기능성 포트 <a class="header-anchor" href="#기능성-포트" aria-label="Permalink to &quot;기능성 포트&quot;">​</a></h2><p><img src="'+a+'" alt="MINI II 1"></p><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p><a href="http://www.femtomes.com" target="_blank" rel="noreferrer">MINI2 수신기</a>는 데이터용 비행 콘트롤러(GPS 포트)의 UART에 연결됩니다. 모듈에 전원을 공급하기 위하여, 별도의 12V 전원공급장치가 필요합니다. 12핀 커넥터 핀은 아래와 같이 번호가 지정됩니다.</p><p><img src="'+r+'" alt="MINI_II_2"></p><h2 id="설정" tabindex="-1">설정 <a class="header-anchor" href="#설정" aria-label="Permalink to &quot;설정&quot;">​</a></h2><p>방향 추정을 위해 두 안테나는 같은 높이에 있어야하고, 서로 최소 30cm 떨어져 있어야합니다. 두 GPS가 향하는 방향은 <a href="./../advanced_config/parameter_reference.html#GPS_YAW_OFFSET">GPS_YAW_OFFSET</a> 매개변수로 설정할 수 있습니다.</p><p>Configure the serial port on which the <a href="http://www.femtomes.com/#/MiniII?type=0" target="_blank" rel="noreferrer">MINI2 Receiver</a> will run using <a href="./../advanced_config/parameter_reference.html#GPS_1_CONFIG">GPS_1_CONFIG</a>, and set the baud rate to 115200 using <a href="./../advanced_config/parameter_reference.html#SER_GPS1_BAUD">SER_GPS1_BAUD</a>.</p><p>설정후에는 수신기는 다른 <a href="./../gps_compass/rtk_gps.html">RTK GPS</a>와 동일한 방식으로 사용됩니다 (즉, Survey-in 프로세스와 관련하여).</p><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><p>MINI2는 다음 구성 요소를 통합합니다.</p><ul><li><p><a href="http://www.femtomes.com/#/FB672" target="_blank" rel="noreferrer">FB672</a>: Compact, dual antenna, dual frequency GNSS OEM board (delivers centimeter accurate position and precise heading).</p><p><img src="'+t+'" alt="FB672"></p></li><li><p><a href="http://www.femtomes.com/#/FB6A0" target="_blank" rel="noreferrer">FB6A0</a>: Compact, quadruple frequency GNSS OEM board (delivers centimeter-accurate positioning)</p><p><img src="'+i+'" alt="FB6A0"></p></li></ul><p>자세한 제품 매뉴얼은 공식 웹 사이트와 제조사에 문의하십시오.</p>',24),c=[m];function _(h,d,f,u,g,I){return s(),n("div",null,c)}const P=o(p,[["render",_]]);export{k as __pageData,P as default};
